eval("__webpack_require__.r(__webpack_exports__);\nvar messages = {\n  en: {\n    lede: 'Compare cancer risk factors in an understandable way. Currently listing {risks} risk factors.',\n    'Newsletter': 'Newsletter',\n    newsletter1: 'Write down your e-mail in the box below and you\\'ll receive my next text directly in your inbox.',\n    'Your e-mail address here': 'Your e-mail address here',\n    'Submit': 'Submit',\n    'An interactive database by': 'An interactive database by',\n    '20 December 2018': '20 December 2018',\n    'Cancer Risks': 'Cancer Risks',\n    'Share': 'Share',\n    'Cancer site': 'Cancer site',\n    'Risk factor': 'Risk factor',\n    share_text: 'Compare cancer risk factors in an understandable way.',\n    factors: {\n      'alcohol': 'Alcohol',\n      'aluminum_deo': 'Aluminum deodorant',\n      'processed_meat': 'Processed meat',\n      'red_meat': 'Red meat',\n      'coffee': 'Coffee',\n      'air_pollution': 'Air pollution',\n      'mobile_phones': 'Mobile phones',\n      'cig_smoke': 'Cigarette smoke',\n      'hairdresser': 'Hairdresser (work as)'\n    },\n    cancers: {\n      \"colorectum\": \"Colorectum\",\n      \"oral_cavity_and_pharynx\": \"Oral cavity and pharynx\",\n      \"larynx\": \"Larynx\",\n      'lung': 'Lung',\n      'bladder': 'Bladder',\n      'lung_smoke': 'Lung',\n      'brain': 'Brain',\n      \"oesophagus\": \"Oesophagus\",\n      \"female_breast\": \"Female breast\",\n      \"all\": \"All\"\n    },\n    actions: {\n      \"drink50g\": \"drink 50g of pure alcohol (half a bottle of wine or a liter of beer) per day\",\n      \"useDeodorant\": \"use an aluminum deodorant every day\",\n      \"eat50gprocessedmeat\": \"eat 50g of processed meat per day\",\n      \"eat100gredmeat\": \"eat 100g of processed meat per day\",\n      \"drinkCoffee\": \"drink coffee every day\",\n      \"live20mug\": \"live in a city with a concentration of PM<sub>2.5</sub> over 20μg/m<sup>3</sup> (about the level of pollution in Berlin)\",\n      \"cellphone\": \"hold a cell phone to their ear for less than 30 minutes per day\",\n      'smoke': 'smoke around 20 cigarettes per day',\n      'work_as_hairdresser': 'work as a hairdresser for about 10 years'\n    },\n    comparator: {\n      source: \"Source: {source} <a href=\\\"{source_url}\\\" target=\\\"_blank\\\">Link</a>.\",\n      disclaimer: \"Scientists conducted several studies and could not find a link between this factor and any cancer. \",\n      nonsmokers: \"nonsmokers\",\n      males: \"males\",\n      females: \"females\",\n      persons: \"persons\",\n      a_cancer: \"a cancer\",\n      cancer_type: \"a {cancer} cancer\",\n      sentence_right: \"Out of {amount} {persons} who {action}, <span class=\\\"big-number\\\">{rate}</span> develop {cancer_type} over their lifetime.\",\n      sentence_left: \"Out of {amount} {persons} in the general population, <span class=\\\"big-number\\\">{rate}</span> develop {cancer_type} over their lifetime.\"\n    },\n    copy: {\n      main: \"\\n        <p>\\n          Aspirin <a href=\\\"https://www.dailymail.co.uk/health/article-205490/Asprin-link-cancer-risk.html\\\" target=\\\"_blank\\\">causes</a> cancer, said the <em>Daily Mail</em>. It also <a href=\\\"https://www.dailymail.co.uk/health/article-1174691/Taking-aspirin-40s-cuts-cancer-risk.html\\\" target=\\\"_blank\\\">prevents</a> it, said the same source. Onions <a href=\\\"https://www.dailymail.co.uk/health/article-207275/Onions-fight-prostate-cancer.html\\\" target=\\\"_blank\\\">reduce</a> cancer risk, while artificial lights <a href=\\\"https://www.dailymail.co.uk/health/article-391267/Artificial-light-increases-breast-cancer-risk.html\\\" target=\\\"_blank\\\">increase</a> it.\\n        </p>\\n        <p>\\n          These examples are taken from Paul Battley's hilarious <a href=\\\"http://kill-or-cure.herokuapp.com\\\" target=\\\"_blank\\\">Kill or Cure</a>, an attempt to structure the <em>Daily Mail</em>'s classification all things as either causing or preventing cancer. While the <em>Mail</em> can hardly be said to report accurate information, it is not rare to find similarly approximate reporting on the issue of cancer risks in actual newspapers.\\n        </p>\\n        <p>\\n          Because few journalists understand scientific articles and many universities are prone to hyping insignificant results, it can be hard to access solid evidence on cancer risks.</p>\\n        <img src=\\\"https://blog.nkb.fr/cancer-risks/graph_en.png\\\" />\\n        <p>\\n          Several groups of scientists compile the available evidence on cancer risks, most notably the International Agency for Research on Cancer. Their monographies are comprehensive but hard to read. I extracted the risk-related data to make it easily digestible. The numbers below are not definitive (establishing the cause of a cancer is notoriously difficult) but the orders of magnitude they convey are more informative that the headlines in most news reports.\\n        </p>\\n        <p>\\n          Choose a risk factor and a cancer site below to see how the absolute risk changes.\\n        </p>\",\n      limitations: \"\\n        <h2>Limitations</h2>\\n        <p>\\n          The data for the general population are from the United States. Conditions in your country might differ.\\n        </p>\\n        <p>\\n          That no evidence of a link between a factor and cancer has been found does not mean that there is no link (it is impossible to prove that there is no relationship between the two). While further research might prove that a factor or another does cause cancer, the examples shown here have already undergone several serious studies on animals and on humans, non of which conclusively showed a link.\\n        </p>\\n        <p>\\n          Not being an oncologist, I might have made mistakes. The data is available in <a href=\\\"https://docs.google.com/spreadsheets/d/1QTflR63InxdWNeJGgpYgnd7rCC_r7SzZlOTiyGnkQHw/edit?usp=sharing\\\">this spreadsheet</a>. Do send me an e-mail at hi@nkb.fr if something is amiss or if you would like to add data on a different risk factor.\\n        </p>\"\n    }\n  },\n  de: {\n    lede: 'Krebsrisikofaktoren leicht verstehen. Zurzeit sind {risks} Risikofaktoren vergleichbar.',\n    'Newsletter': 'Newsletter',\n    newsletter1: 'Hinterlassen Sie Ihre Email Adresse um meine nächsten Essays (meistens auf Englisch) direkt per Email zu bekommen.',\n    'Your e-mail address here': 'Ihre Email Adresse hier',\n    'Submit': 'Abschicken',\n    'An interactive database by': 'Eine Datenbank von',\n    'Share': 'Teilen',\n    '20 December 2018': '20. Dezember 2018',\n    'Cancer Risks': 'Krebsrisiko'\n  },\n  fr: {\n    lede: 'Comparez les risques de cancer facilement et clairement. {risks} facteurs de risque sont disponibles pour l\\'instant.',\n    'Newsletter': 'Newsletter',\n    newsletter1: 'Abonnez-vous pour recevoir mes prochains articles par e-mail.',\n    'Your e-mail address here': 'Votre adresse e-mail',\n    'Submit': 'Envoyer',\n    'An interactive database by': 'Une base de données par',\n    '20 December 2018': '20 décembre 2018',\n    'Cancer Risks': 'Risques de cancer',\n    'Share': 'Partager',\n    'Cancer site': 'Type de cancer',\n    'Risk factor': 'Facteur de risque',\n    share_text: 'Comparez les risques de cancer facilement et clairement.',\n    factors: {\n      'alcohol': 'Alcool',\n      'aluminum_deo': 'Aluminum (déodorant)',\n      'processed_meat': 'Viande transformée',\n      'red_meat': 'Viande rouge',\n      'coffee': 'Café',\n      'air_pollution': 'Pollution atmosphérique',\n      'mobile_phones': 'Téléphones portables',\n      'cig_smoke': 'Cigarettes',\n      'hairdresser': 'Coiffeur (profession)'\n    },\n    cancers: {\n      \"colorectum\": \"Côlon\",\n      \"oral_cavity_and_pharynx\": \"Pharynx et bouche\",\n      \"larynx\": \"Larynx\",\n      'lung': 'Poumon',\n      'bladder': 'Vessie',\n      'lung_smoke': 'Poumon',\n      'brain': 'Cerveau',\n      \"oesophagus\": \"Œsophage\",\n      \"female_breast\": \"Sein féminin\",\n      \"all\": \"Tous\"\n    },\n    actions: {\n      \"drink50g\": \"boivent 50g d'alcool pur (une demie bouteille de vin ou un litre de bière) par jour\",\n      \"useDeodorant\": \"utilisent un déodorant à base d'aluminium tous les jours\",\n      \"eat50gprocessedmeat\": \"mangent 50g de viande transformée tous les jours\",\n      \"eat100gredmeat\": \"mangent 50g de viande rouge tous les jours\",\n      \"drinkCoffee\": \"boivent du café tous les jours\",\n      \"live20mug\": \"vivent dans une ville où la concentration en PM<sub>2.5</sub> dépasse 20μg/m<sup>3</sup> (un peu plus que la moyenne annuelle à Paris)\",\n      \"cellphone\": \"ont un téléphone à l'oreille moins de 30 minutes par jour\",\n      'smoke': 'fument environ 20 cigarettes par jour',\n      'work_as_hairdresser': 'travaillent en tant que coiffeur pendant au moins 10 ans'\n    },\n    comparator: {\n      source: \"Source: {source} <a href=\\\"{source_url}\\\" target=\\\"_blank\\\">Lien</a>.\",\n      disclaimer: \"Des scientifiques ont mené plusieurs études et n'ont pas trouvé de lien entre ce facteur de risque et le cancer. \",\n      nonsmokers: \"non-fumeurs\",\n      males: \"hommes\",\n      females: \"femmes\",\n      persons: \"personnes\",\n      a_cancer: \"un cancer\",\n      cancer_type: \"un cancer ({cancer})\",\n      sentence_right: \"Pour {amount} {persons} qui {action}, <span class=\\\"big-number\\\">{rate}</span> ont {cancer_type} au cours de leur vie.\",\n      sentence_left: \"Pour {amount} {persons} parmi l'ensemble de la population, <span class=\\\"big-number\\\">{rate}</span> ont {cancer_type} au cours de leur vie.\"\n    },\n    copy: {\n      main: \"\\n        <p>\\n          L'aspirine <a href=\\\"https://www.dailymail.co.uk/health/article-205490/Asprin-link-cancer-risk.html\\\" target=\\\"_blank\\\">provoque</a> le cancer, a un jour titr\\xE9 le <em>Daily Mail</em>. L'aspirine <a href=\\\"https://www.dailymail.co.uk/health/article-1174691/Taking-aspirin-40s-cuts-cancer-risk.html\\\" target=\\\"_blank\\\">pr\\xE9vient</a> le cancer, a-t-il titr\\xE9 un autre jour. Les oignons <a href=\\\"https://www.dailymail.co.uk/health/article-207275/Onions-fight-prostate-cancer.html\\\" target=\\\"_blank\\\">r\\xE9duisent</a> le risque de cancer et les lumi\\xE8res artificielles <a href=\\\"https://www.dailymail.co.uk/health/article-391267/Artificial-light-increases-breast-cancer-risk.html\\\" target=\\\"_blank\\\">l'augmentent</a>.\\n        </p>\\n        <p>\\n          Ces exemples viennent du g\\xE9nial <a href=\\\"http://kill-or-cure.herokuapp.com\\\" target=\\\"_blank\\\">Kill or Cure</a> de Paul Battley, une liste de tout ce que le <em>Daily Mail</em> a un jour class\\xE9 dans la cat\\xE9gorie \\xAB&nbsp;canc\\xE9rig\\xE8ne&nbsp;\\xBB ou \\xAB&nbsp;anti-cancer&nbsp;\\xBB (ou les deux \\xE0 la fois). On sait bien que le <em>Mail</em> a abandonn\\xE9 toute pr\\xE9tention \\xE0 faire du journalisme il y a fort longtemps, mais m\\xEAme les journaux s\\xE9rieux ont du mal avec la communication des risques, surtout quand on parle de sant\\xE9.\\n        </p>\\n        <p>\\n          D'une part, peu de journalistes sont \\xE0 l'aise avec les articles scientifiques. D'autre part, les universit\\xE9s n'h\\xE9sitent pas \\xE0 d\\xE9former des r\\xE9sultats pour embellir un communiqu\\xE9 de presse. Au final, il est tr\\xE8s difficile de conna\\xEEtre l'\\xE9tat de la recherche sur les facteurs de risques de cancer.</p>\\n        <img src=\\\"https://blog.nkb.fr/cancer-risks/graph_fr.png\\\" />\\n        <p>\\n          Plusieurs consortiums de scientifiques \\xE9valuent et compilent les \\xE9tudes sur le sujet, notamment le Centre international de recherche sur le cancer. Ses monographies sont tr\\xE8s compl\\xE8tes mais pas \\xE9videntes \\xE0 lire. J'en ai extrait les donn\\xE9es sur les risques pour les rendre plus facilement compr\\xE9hensibles. Les chiffres ci-dessous ne sont pas d\\xE9finitifs (\\xE9tablir la cause pr\\xE9cise d'un cancer est particuli\\xE8rement difficile) mais leurs ordres de grandeur sont sans doute plus informatifs que les gros titres de certains journaux.\\n        </p>\\n        <p>\\n          Choisissez un facteur de risque et un type de cancer dans les listes ci-dessous et voyez comment le risque absolu change.\\n        </p>\",\n      limitations: \"\\n        <h2>N'oubliez pas vos pincettes</h2>\\n        <p>\\n          Les donn\\xE9es concernant la population dans son ensemble valent pour les Etats-Unis uniquement. Les conditions dans votre pays peuvent \\xEAtre diff\\xE9rentes.\\n        </p>\\n        <p>\\n          Lorsqu'il n'existe pas de preuve d'un lien entre un facteur de risque et un type de cancer, cela ne veut pas dire qu'il n'y a pas de lien (prouver l'inexistance d'un lien est impossible). Il est possible qu'une \\xE9tude prouve un jour un tel lien. Les exemples inclus ici ont toutefois fait l'objet de nombreuses \\xE9tudes sur des animaux et des humains et aucune n'a apport\\xE9 de preuve probante.\\n        </p>\\n        <p>\\n          Je ne suis pas oncologue et j'ai pu faire des erreurs. Les donn\\xE9es utilis\\xE9es sont disponibles dans <a href=\\\"https://docs.google.com/spreadsheets/d/1QTflR63InxdWNeJGgpYgnd7rCC_r7SzZlOTiyGnkQHw/edit?usp=sharing\\\">cette feuille de calcul</a>. Envoyez moi un message \\xE0 hi@nkb.fr si quelque chose vous tracasse ou si vous voulez ajouter un facteur de risque.\\n        </p>\"\n    }\n  }\n};\n/* harmony default export */ __webpack_exports__[\"default\"] = (messages);//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/assets/texts.js\n");

